  JWARREN, Roger Greville and TURNER, Jenifer Jane Mandeville
  WARREN, Roger Greville and TURNER, Jeni fer Jane Mandeville (cont...)
  Director of the Red Cross Society for the Waikato Region.
  Jenifer was educated at Woodford House and trained as a Karitane nurse. Social work has included work
  with the deaf, Birthright, the Justice Department and mental health. From 1982 to 1994 she and Roger
  operated motel style units overlooking Lake Areare, north of Hamilton, for people needing rest and
  recuperation.
  01> WARREN, David Roger
  b 07.06.1959
  David b. at Dannevirke. Address: 22 Mount View Road, Melville, Hamilton.
  David was educated at Kelston School for the Deaf and Melville High School, Hamilton. He attended
  Waikato Technical Institute (he was the first profoundly deaf student in New Zealand to do so) and
  was awarded a Certificate in Display Advertising. He started work as a caster for Hereford Fine
  China. He is a proficient spinner, potter and craftsperson.
  02> WARREN, Neil Mandeville m on 27.02.1993 to SABIN, Tracey
  b 29.06.1961
  b ** ** 1965
  Neil b, at Dannevirke. Address: 48a Cowley Drive, Cambridge.
  Neil was educated at Southwell Preparatory School, St Paul's Collegiate and Lincoln College
  (DipAg). He is now a Police officer in Cambridge.
  Tracey is a flight attendant with Air New Zealand.
  01> WARREN, Olivia Evelyn
  b 28.04.1992
  02> WARREN, Sophie Jenifer
  b 24.11.1995
  03> WARREN, Juliet Roese m on 23.04.1994 to PAGE, Andrew Edward
  b 10.11.1965
  b 13.02.1964
  Juliet b. at Auckland. Andrew b. at Auckland. Address: 34a Prestons Road, Redwood, Christchurch.
  Juliet was educated at Waikato Diocesan School for Girls and Central Institute of Technology,
  Wellington (Dip in Pharmacy, and Pharmaceutical Society Scholarship). She is now a mother/locum
  pharmacist in Christchurch.
  Andrew is an electrical engineer working in the power industry.
  01> PAGE , Matthew Edward
  b 17.07.1996
  Matthew b. at Hamilton.
  03> WARREN, Peter Cory m on 23.11.1958 to (1) FLETCHER, Margaret Mary
  b 22.06.1935
  b 19.12.1937
  Peter b. at Hastings and m, at Waimate by his uncle, Bishop Alwyn Warren. Mary, d/o w J Fletcher of
  Willowbridge.
  01> WARREN, Christopher Williams
  b 15.09.1959
  Christopher was educated at Hereworth School, Havelock North, and Nelson College then spent a year
  at Canterbury University. Since then he has been working in the meat industry.
